import Footer from './components/Footer';
import Navbar from './components/navbar/Navbar';
import './App.css'
import Home from './components/Pages/Home/Home';
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
      </Routes>
      {/* <Footer/> */}
    </div>
  );
}

export default App;
